import React, { Component } from 'react';
import { Button } from 'react-native-elements';



class Kayitlogo extends Component {
    render() {
        return (
            <Button className='kitapkayit' href="/kitapkayit">
               
            </Button>
        )
    }
}
export default Kayitlogo;
